import { createAsyncThunk } from '@reduxjs/toolkit';
import axios from 'axios';

const addCreature = createAsyncThunk('creatures/add', async () => {
  const response = await axios.post('http://localhost:3005/users', {
    name: "",
    index: "",
    URL: ""
  });

  return response.data;
});

export { addCreature };
